import "./App.css";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
import SmallNav from "./Components/smallNav";
import MainNav from "./Components/mainNav";

function App() {
  return (
    <Router>
      <SmallNav />
      <MainNav />
    </Router>
  );
}

export default App;
